import { styled } from "styled-components";

export const Container = styled.div`
  position: relative;
  width: 393px;
  height: 816px;
  align-items: center;
  background: #fff;
  margin: 0 auto;
`;

export const Bar = styled.div`
  display: flex;
  flex-direction: row;
  width: 393px;
  height: 44px;
  flex-shrink: 0;
  #Time {
    margin-top: 12px;
    margin-left: 10px;
    float: right;
    position: absolute;
    color: #000;
    text-align: center;
    font-family: "Pretendard Variable";
    font-size: 18px;
    font-style: normal;
    font-weight: 500;
    line-height: 25px; /* 138.889% */
  }
  #Connection {
    margin-top: 14px;
    margin-left: 310px;
    width: 16px;
    height: 12.173px;
    flex-shrink: 0;
  }
  #Wifi {
    margin-top: 14px;
    margin-left: 8px;
    width: 16px;
    height: 12.173px;
    flex-shrink: 0;
  }
  #Battery {
    margin-top: 14px;
    margin-left: 8px;
    width: 25px;
    height: 12.173px;
    flex-shrink: 0;
  }
`;

export const Background = styled.div`
  width: 393px;
  height: 40px;
  display: flex;
  flex-direction: row;
  margin-top: 20px;

  #back {
    width: 30px;
    height: 30px;
    flex-shrink: 0;
    margin-left: 20px;
  }

  #my {
    margin-left: 125px;
    width: 33px;
    height: 26px;
    flex-shrink: 0;
    color: #530093;
    font-family: "Pretendard Variable";
    font-size: 22px;
    font-style: normal;
    font-weight: 400;
    line-height: normal;
  }

  #headset {
    margin-left: 86px;
    width: 24px;
    height: 24px;
    flex-shrink: 0;
  }

  #setting {
    margin-left: 21px;
    width: 24px;
    height: 24px;
    flex-shrink: 0;
  }
`;

export const Me = styled.div`
  display: flex;
  width: 83px;
  height: 90.403px;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  flex-shrink: 0;
  margin-top: 28px;
  margin-left: 150px;
`;

export const Information = styled.div`
  width: 126px;
  height: 37px;

  #name {
    color: #000;
    font-family: "Pretendard Variable";
    font-size: 16px;
    font-style: normal;
    font-weight: 500;
    line-height: normal;
    letter-spacing: -0.4px;
  }

  #email {
    width: 126px;
    height: 16.309px;
    flex-shrink: 0;
    color: #686868;
    font-family: "Pretendard Variable";
    font-size: 14px;
    font-style: normal;
    font-weight: 400;
    line-height: normal;
    letter-spacing: -0.35px;
  }
`;

export const Line = styled.div`
  width: 393px;
  height: 3px;
`;
